int dp[2][100001];
inline int _abs(int a)
{
    return a < 0 ? -a : a;
}
inline int _min(int a, int b)
{
    return a < b ? a : b;
}
int closestToTarget(vector<int> &arr, int target)
{
    int n = arr.size();
    int ans = INT32_MAX;
    for (int i = 0; i < n; ++i)
    {
        ans = _min(ans, _abs(arr[i] - target));
        dp[0][i] = arr[i];
    }
    int layer = 1;
    for (int i = 1; i < n; ++i)
    {
        for (int j = 0; i + j < n; ++j)
        {
            dp[layer][j] = dp[1 - layer][j] & arr[j + i];
            ans = _min(ans, _abs(dp[layer][j] - target));
        }
        layer = 1 - layer;
    }
    return ans;
}

